import React from 'react';
import {HashRouter, Route, Switch} from 'react-router-dom';
import index from './index';
import App from './App';


const BasicRoute = () => (
    <Route>
    <Route path="/" component={index} />
    <Route path="/app" component={App} />
    </Route>
);


export default BasicRoute;
